import React from 'react'
import { Progress } from 'antd';

function Charts() {
    return (
        <div class="main-content bg-gradient-primary mt-4">
      
                <div class="container-fluid">
                    <h2 class="mb-2 text-white">Statistics Detail</h2>
                    <div class="header-body">
                    <Progress type="circle"style={{color:'green',background:'red'}} percent={75} />
                    <Progress type="circle" percent={10} />
                    <Progress type="circle" percent={12} />
                    <Progress type="circle" percent={90} />

                    </div>
                </div>
           
            {/* <!-- Page content --> */}
        </div>
    )
}

export default Charts
